        <div className=" container-fluid mt-5" id="product">
          $nbps;
          <h2> Latest</h2>
          <p></p>

          <div className="row">
           {this.state.data.map((dynamicData,key)=>(

          <div className="col-lg-3 col-md-3 col-sm-3   animated fadeInUp wow animated">
