              <img
                src={dynamicData.urlToImage}
                className="img1"
                alt=""
              />
              <div className="overlay">
                <button
                  type="button"
                  className="btn btn-secondary"
                  title="Quick Shop"

                  //data-toggle="modal"
                  //data-target="#quickModel"
                >
                  <i className="fa fa-eye"></i>
                </button>

                <button
                  type="button"
                  className="btn btn-secondary"
                  title="Add to Cart"
                >
                  <i className="fa fa-shopping-cart"></i>
